  DECLARE
  ttl_str   VARCHAR(4000)  ;
  row_str   VARCHAR(4000)  ;
BEGIN	
	IF v_cur = '{}' then
	 	ttl_str = '';
	 ELSE
		FOR i IN 1 .. array_upper(v_cur, 1)
		LOOP		
			IF v_cur[1] != '' THEN				
			    IF ttl_str != '' THEN
		           ttl_str = ttl_str ||v_row_split;
		        END IF;		       
		        ttl_str = ttl_str || v_cur[i];	
		     END IF;		    
	     END LOOP;	    
	 END IF;	 
    RETURN ttl_str; 	
END;

	declare 
  V_CCT                 DATE; 
  IS_LOOP               BOOLEAN :=TRUE; 
  CNT                   integer:=0; 
  I_ETB                 DATE;  
  I_ETD                 DATE;  
  V_BASE_DT             DATE; 
  V_BASE_CCT            DATE; 
   
  V_CCT_TRUNC_FLG       VARCHAR(1) :=''; 
  V_YD_BSE_CALC_FLG     VARCHAR(1) :=''; 
  V_CCT_TP_CD           VARCHAR(3) :='';  
  V_CCT_HR              VARCHAR(2) :='';  
  V_CCT_DY_CD           VARCHAR(3) :=''; 
  V_CCT_HRMNT           VARCHAR(4) :=''; 
  V_XCLD_HOL_FRI_FLG    VARCHAR(1) :=''; 
  V_XCLD_HOL_SAT_FLG    VARCHAR(1) :=''; 
  V_XCLD_HOL_SUN_FLG    VARCHAR(1) :=''; 
  V_XCLD_HOL_HOL_FLG    VARCHAR(1) :='';   
   
  V_GATE_OPN_HRMNT      VARCHAR(4) :=''; 
  V_GATE_CLZ_HRMNT      VARCHAR(4) :=''; 
  V_HOL_GATE_OPN_HRMNT  VARCHAR(4) :=''; 
  V_HOL_GATE_CLZ_HRMNT  VARCHAR(4) :=''; 
  V_SUN_GATE_OPN_HRMNT  VARCHAR(4) :=''; 
  V_SUN_GATE_CLZ_HRMNT  VARCHAR(4) :=''; 
  V_SAT_GATE_OPN_HRMNT  VARCHAR(4) :=''; 
  V_SAT_GATE_CLZ_HRMNT  VARCHAR(4) :=''; 
  V_GATE_FROM_HRMNT     VARCHAR(4) :=''; 
  V_GATE_TO_HRMNT       VARCHAR(4) :=''; 
   
  BEGIN 
 
    BEGIN 
     
     
     
        IF I_VVD IS NOT NULL THEN 
             SELECT  
                (CASE WHEN I_CGO_TP_CD  ='DG' THEN VGM_CLZ_DT 
                      WHEN I_CGO_TP_CD  ='RF' THEN VGM_CLZ_DT 
                      ELSE VGM_CLZ_DT  
                 END ) 
             INTO V_CCT 
             FROM VSK_VSL_PORT_SKD 
             WHERE VSL_CD =SUBSTR(I_VVD,1,4) 
             AND SKD_VOY_NO =SUBSTR(I_VVD,5,4)  
             AND SKD_DIR_CD =SUBSTR(I_VVD,9,1)  
             AND YD_CD = I_YD_CD 
             AND CLPT_IND_SEQ = coalesce(I_CLPT_IND_SEQ, CLPT_IND_SEQ) ; 
        END IF ;     
         
          
 
        IF V_CCT IS NOT NULL THEN  
            RETURN V_CCT ;   
        END IF ; 
 
        EXCEPTION WHEN OTHERS 
        THEN  
--        DBMS_OUTPUT.PUT_LINE('RESULT_V_CCT1 :  ' ||V_CCT) ; 
        NULL ; 
         
     
    END ;         
     
    BEGIN 
     
        
     
    SELECT   
        coalesce(CCT_FILE_FLG,'0'), coalesce(YD_BSE_CALC_FLG,'0'), CCT_TP_CD, CCT_HR, CCT_DY_CD, CCT_HRMNT,  
        XCLD_HOL_FRI_FLG,XCLD_HOL_SAT_FLG,XCLD_HOL_SUN_FLG,XCLD_HOL_HOL_FLG   
    INTO V_CCT_TRUNC_FLG,V_YD_BSE_CALC_FLG,V_CCT_TP_CD,V_CCT_HR,V_CCT_DY_CD,V_CCT_HRMNT, 
         V_XCLD_HOL_FRI_FLG,V_XCLD_HOL_SAT_FLG,V_XCLD_HOL_SUN_FLG,V_XCLD_HOL_HOL_FLG 
    FROM  
      ( 
        SELECT  
            VGM_CLZ_FILE_FLG AS CCT_FILE_FLG,  
            YD_BSE_CALC_FLG, 
            VGM_CLZ_TP_CD AS CCT_TP_CD,  
            VGM_CLZ_HR AS CCT_HR,  
            VGM_CLZ_DY_CD AS CCT_DY_CD, 
            VGM_CLZ_HRMNT AS CCT_HRMNT,  
            VGM_XCLD_HOL_FRI_FLG AS XCLD_HOL_FRI_FLG, 
            VGM_XCLD_HOL_SAT_FLG AS XCLD_HOL_SAT_FLG, 
            VGM_XCLD_HOL_SUN_FLG AS XCLD_HOL_SUN_FLG, 
            VGM_XCLD_HOL_HOL_FLG AS XCLD_HOL_HOL_FLG,  
            RANK() OVER (PARTITION BY YD_CD ORDER BY CASE WHEN CGO_TP_CD= I_CGO_TP_CD THEN 1  ELSE 2 END) RNK 
        FROM PRD_TML_CCT_MGMT X 
        WHERE YD_CD = I_YD_CD 
        AND VSL_SLAN_CD  IN (coalesce(I_VSL_SLAN_CD,'ALL'), 'ALL') 
        AND coalesce(DELT_FLG,'N') <> 'Y' 
        AND VSL_SLAN_DIR_CD IN (I_VSL_SLAN_DIR_CD, 'A') 
        AND CGO_TP_CD IN (I_CGO_TP_CD,'AL')                  
        AND CASE WHEN VSL_SLAN_CD='ALL' THEN  20  ELSE 0 END  + CASE WHEN VSL_SLAN_DIR_CD='A' THEN  10  ELSE 0 END  + CASE WHEN CGO_TP_CD='AL' THEN  1  ELSE 0 END =  
        (SELECT MIN(CASE WHEN Y.VSL_SLAN_CD='ALL' THEN  20  ELSE 0 END  + CASE WHEN Y.VSL_SLAN_DIR_CD='A' THEN  10  ELSE 0 END  + CASE WHEN Y.CGO_TP_CD='AL' THEN  1  ELSE 0 END )
           FROM PRD_TML_CCT_MGMT Y 
          WHERE X.YD_CD = Y.YD_CD 
            AND coalesce(Y.DELT_FLG,'N') <> 'Y' 
            AND Y.VSL_SLAN_CD IN (coalesce(I_VSL_SLAN_CD,'ALL'), 'ALL') 
            AND Y.VSL_SLAN_DIR_CD IN (coalesce(I_VSL_SLAN_DIR_CD, 'A'), 'A') 
            AND Y.CGO_TP_CD IN (coalesce(I_CGO_TP_CD,'AL'), 'AL')
         )                 
      ) ALIAS1
    WHERE RNK =1 ;     
     
   SELECT  coalesce(GATE_OPN_HRMNT,'0000'), coalesce(GATE_CLZ_HRMNT,'2359'), 
           coalesce(HOL_GATE_OPN_HRMNT,'0000'),coalesce(HOL_GATE_CLZ_HRMNT,'2359'), 
           coalesce(SUN_GATE_OPN_HRMNT,'0000'),coalesce(SUN_GATE_CLZ_HRMNT,'2359'), 
           coalesce(SAT_GATE_OPN_HRMNT,'0000'),coalesce(SAT_GATE_CLZ_HRMNT,'2359') 
     INTO  V_GATE_OPN_HRMNT,V_GATE_CLZ_HRMNT,    
           V_HOL_GATE_OPN_HRMNT,V_HOL_GATE_CLZ_HRMNT,  
           V_SUN_GATE_OPN_HRMNT,V_SUN_GATE_CLZ_HRMNT,  
           V_SAT_GATE_OPN_HRMNT,V_SAT_GATE_CLZ_HRMNT   
     FROM  MDM_YARD 
    WHERE  YD_CD = I_YD_CD ;     
     
     
     
    IF V_CCT_TRUNC_FLG = '1' THEN  
        I_ETB := date_trunc('day',I_ETB_DT) ; 
        I_ETD := date_trunc('day',I_ETD_DT) ; 
    ELSE 
        I_ETB := I_ETB_DT ; 
        I_ETD := I_ETD_DT ; 
    END IF ; 
     
 
     
         
    IF V_CCT_TP_CD IN ('ETB','ETD') AND V_YD_BSE_CALC_FLG = '1' THEN 
        V_CCT_HRMNT := NULL ; 
    END IF ; 
     
   
      
V_CCT :=  CASE   --concat('2','hours')::interval concat(V_CCT_HR,'hours')
                WHEN V_CCT_TP_CD = 'ETB' THEN to_timestamp(TO_CHAR(date_trunc('day',I_ETB - concat(V_CCT_HR,'hours')::interval), 'YYYY/MM/DD')||coalesce(V_CCT_HRMNT,TO_CHAR(I_ETB - concat(V_CCT_HR,'hours')::interval,'HH24MI')), 'YYYY/MM/DDHH24MI')  
                WHEN V_CCT_TP_CD = 'ETD' THEN to_timestamp(TO_CHAR(date_trunc('day',I_ETD - concat(V_CCT_HR,'hours')::interval), 'YYYY/MM/DD')||coalesce(V_CCT_HRMNT,TO_CHAR(I_ETD - concat(V_CCT_HR,'hours')::interval,'HH24MI')), 'YYYY/MM/DDHH24MI')  
                -- DAY ( 옜 옜?옜옜 ETB ?옜?옜?   
                WHEN V_CCT_TP_CD = 'Day' THEN  
                      CASE WHEN date_trunc('day',I_ETB)  >  --옜 
						   to_timestamp(TO_CHAR(date_trunc('day',I_ETB) - '1d'::interval + CONCAT(
						   CASE  WHEN V_CCT_DY_CD = 'SUN' THEN '0' 
                                 WHEN V_CCT_DY_CD = 'MON' THEN '1' 
                                 WHEN V_CCT_DY_CD = 'TUE' THEN '2' 
                                 WHEN V_CCT_DY_CD = 'WED' THEN '3' 
                                 WHEN V_CCT_DY_CD = 'THU' THEN '4' 
                                 WHEN V_CCT_DY_CD = 'FRI' THEN '5' 
                                 WHEN V_CCT_DY_CD = 'SAT' THEN '6' 
                           END
								,'DAY')::interval,'YYYY/MM/DD')
								||V_CCT_HRMNT
								, 'YYYY/MM/DDHH24MI') 
                           THEN  
						   to_timestamp(TO_CHAR(date_trunc('day',I_ETB) - '1d'::interval + CONCAT(
						   CASE  WHEN V_CCT_DY_CD = 'SUN' THEN '0' 
                                 WHEN V_CCT_DY_CD = 'MON' THEN '1' 
                                 WHEN V_CCT_DY_CD = 'TUE' THEN '2' 
                                 WHEN V_CCT_DY_CD = 'WED' THEN '3' 
                                 WHEN V_CCT_DY_CD = 'THU' THEN '4' 
                                 WHEN V_CCT_DY_CD = 'FRI' THEN '5' 
                                 WHEN V_CCT_DY_CD = 'SAT' THEN '6' 
                           END
								,'DAY')::interval,'YYYY/MM/DD')
								||V_CCT_HRMNT
								, 'YYYY/MM/DDHH24MI') 
                      ELSE 
                           to_timestamp(TO_CHAR(date_trunc('day',I_ETB) - '8d'::interval + CONCAT(
						   CASE  WHEN V_CCT_DY_CD = 'SUN' THEN '0' 
                                 WHEN V_CCT_DY_CD = 'MON' THEN '1' 
                                 WHEN V_CCT_DY_CD = 'TUE' THEN '2' 
                                 WHEN V_CCT_DY_CD = 'WED' THEN '3' 
                                 WHEN V_CCT_DY_CD = 'THU' THEN '4' 
                                 WHEN V_CCT_DY_CD = 'FRI' THEN '5' 
                                 WHEN V_CCT_DY_CD = 'SAT' THEN '6' 
                           END
								,'DAY')::interval,'YYYY/MM/DD')
								||V_CCT_HRMNT
								, 'YYYY/MM/DDHH24MI')  
                      END       
                 -- CMN : ETB 옜?옜옜  
                 WHEN V_CCT_TP_CD ='CMN' THEN to_timestamp(TO_CHAR(I_ETB - '1d'::interval  , 'YYYY/MM/DD') || V_CCT_HRMNT, 'YYYY/MM/DDHH24MI') 
             END ; 
              
V_BASE_DT := V_CCT ; 
 
    WHILE IS_LOOP AND CNT <30 AND V_YD_BSE_CALC_FLG = '0' LOOP 
        IF ( V_XCLD_HOL_HOL_FLG ='1' AND PRD_GET_HOL_DAY( I_YD_CD, V_BASE_DT  ) ='Y' ) OR  
           ( V_XCLD_HOL_FRI_FLG ='1' AND TO_CHAR(V_BASE_DT,'d') = 6 ) OR 
           ( V_XCLD_HOL_SAT_FLG ='1' AND TO_CHAR(V_BASE_DT,'d') = 7 ) OR 
           ( V_XCLD_HOL_SUN_FLG ='1' AND TO_CHAR(V_BASE_DT,'d') = 1 )              
          THEN              
            V_CCT := V_CCT- '1d'::interval ;   
        ELSIF TRUNC(V_CCT) >= TRUNC(V_BASE_DT)  
                AND NOT ( V_XCLD_HOL_HOL_FLG ='1' AND PRD_GET_HOL_DAY( I_YD_CD, V_BASE_DT  ) ='Y' )  
                AND NOT ( V_XCLD_HOL_FRI_FLG ='1' AND TO_CHAR(V_BASE_DT,'d') = 6 )   
                AND NOT ( V_XCLD_HOL_SAT_FLG ='1' AND TO_CHAR(V_BASE_DT,'d') = 7 )  
                AND NOT ( V_XCLD_HOL_SUN_FLG ='1' AND TO_CHAR(V_BASE_DT,'d') = 1 )  
          THEN  
             IS_LOOP:=FALSE ;    
        END IF;          
        
        CNT:=CNT+1; 
        V_BASE_DT := V_BASE_DT - 1 ; 
         
    END LOOP; 
     
    V_BASE_CCT := V_CCT ; 
     
    WHILE  IS_LOOP AND CNT <30 AND V_YD_BSE_CALC_FLG = '1' LOOP 
     
        IF      TO_CHAR(V_CCT,'d') = 7  THEN  
            V_GATE_FROM_HRMNT  := V_SAT_GATE_OPN_HRMNT; 
            V_GATE_TO_HRMNT    := V_SAT_GATE_CLZ_HRMNT;  
        ELSIF   TO_CHAR(V_CCT,'d') = 1  THEN              
            V_GATE_FROM_HRMNT  := V_SUN_GATE_OPN_HRMNT; 
            V_GATE_TO_HRMNT    := V_SUN_GATE_CLZ_HRMNT;  
        ELSIF   PRD_GET_HOL_DAY( I_YD_CD, V_CCT  ) ='Y'  THEN  
            V_GATE_FROM_HRMNT  := V_HOL_GATE_OPN_HRMNT; 
            V_GATE_TO_HRMNT    := V_HOL_GATE_CLZ_HRMNT;  
        ELSE     
            V_GATE_FROM_HRMNT  := V_GATE_OPN_HRMNT; 
            V_GATE_TO_HRMNT    := V_GATE_CLZ_HRMNT;   
        END IF ;   
         
        IF V_GATE_TO_HRMNT = '0000' THEN   -- 옜 ?      
            V_CCT := V_CCT -1 ;    
             
        ELSIF  TO_CHAR(V_CCT,'HH24MI') > V_GATE_CLZ_HRMNT OR V_BASE_CCT > V_CCT THEN  
            V_CCT := to_timestamp(TO_CHAR(V_CCT,'YYYYMMDD') ||V_GATE_CLZ_HRMNT,'YYYYMMDDHH24MI') ;           
            IS_LOOP := FALSE ; 
        ELSE  
            IS_LOOP := FALSE ; 
        END IF ;             
             
        CNT:=CNT+1; 
         
    END LOOP; 
    EXCEPTION 
          WHEN OTHERS 
          THEN V_CCT := date_trunc('day',I_ETB_DT) - '7h'::interval ; -- Default etb 옜 17:00                
--              dbms_output.put_line('V_CCT-Exce ;;; ' || V_CCT); 
              RETURN V_CCT;   
    END ; 
    RETURN V_CCT;    
END ;

declare
  out_rtn_val varchar(1);
  v_cnt_cd varchar(2);
  v_rgn_cd varchar(3);
  v_ste_cd varchar(3);
  v_loc_cd varchar(5);
  v_yd_cd varchar(7);  
begin
--  dbms_output.enable;
    if length(in_yd_cd)=7 then
        select coalesce(l.cnt_cd, ' '), coalesce(l.rgn_cd, ' '), coalesce(l.ste_cd, ' '), coalesce(l.loc_cd, ' '), y.yd_cd
        into v_cnt_cd, v_rgn_cd, v_ste_cd, v_loc_cd, v_yd_cd
        from mdm_location l, mdm_yard y
        where 1=1
        and l.loc_cd = y.loc_cd
        and y.yd_cd = in_yd_cd;
    else
        select coalesce(l.cnt_cd, ' '), coalesce(l.rgn_cd, ' '), coalesce(l.ste_cd, ' '), coalesce(l.loc_cd, ' '), ' ' as yd_cd
        into v_cnt_cd, v_rgn_cd, v_ste_cd, v_loc_cd, v_yd_cd
        from mdm_location l
        where 1=1
        and l.loc_cd = in_yd_cd;
    end if;

    begin
        SELECT 'Y' chk
        into out_rtn_val
        from dmt_holiday dh
        where 1=1
        and ( cnt_cd, rgn_cd, ste_cd, loc_cd, yd_cd ) =
        (
            select	/*+ no_expand index_desc ( dmt_holiday xpkdmt_holiday ) */
                    cnt_cd, rgn_cd, ste_cd, loc_cd, yd_cd
            from	dmt_holiday 
            where	hol_yr		=	to_char(in_date, 'YYYY')
            and	( cnt_cd	=	v_cnt_cd		or	cnt_cd		=	' ')
            and	( rgn_cd	=	v_rgn_cd		or	rgn_cd		=	' ')
            and	( ste_cd	=	v_ste_cd	    or	ste_cd		=	' ')
            and	( loc_cd	=	v_loc_cd		or	loc_cd		=	' ')
            and	( yd_cd		=	v_yd_cd 		or	yd_cd		=	' ')
            and	rownum		=	1
        )
        and to_char(hol_dt,'YYYYMMDD') = to_char(in_date,'YYYYMMDD');
             
        exception
          when no_data_found
          then
            out_rtn_val:='X';
            return out_rtn_val;
          when others
          then
            out_rtn_val:='X';                    
            RETURN OUT_RTN_VAL;
    end;
        
--        dbms_output.put_line('out_rtn_val  : ' || out_rtn_val  ); 
        return out_rtn_val;
end ;

BEGIN
   new.EDW_UPD_DT := now() at time zone 'singapore';
   RETURN NEW;
END;

DECLARE 
    v_value   text = '';
    v_result  text = '';
BEGIN
	IF i_array = '{}' then
	 	v_result = '';
	 ELSE
		FOR i IN 1 .. array_upper(i_array, 1)
		LOOP		
			IF i_array[1] != '' THEN				
			    IF v_result != '' THEN
		           v_result = v_result ||i_del;
		        END IF;		       
		        v_result = v_result || i_array[i];	
		     END IF;		    
	     END LOOP;	    
	 END IF;	 
    RETURN v_result;
END

  declare OUT_NAME  VARCHAR(100) ;  

    /**
     * Location Code를 이용해서 지역 시간 검색 함수
     * 
     * Ex) SELECT COMMCODE_PKG_GET_COMDTL_NAME_FNC();
     */
    BEGIN
    
        SELECT INTG_CD_VAL_DP_DESC
        INTO   OUT_NAME
        FROM   COM_INTG_CD_DTL
        WHERE  INTG_CD_ID = v_INTG_CD_ID
        AND    INTG_CD_VAL_CTNT  = v_INTG_CD_VAL_CTNT;
        RETURN   OUT_NAME;

    END
